import React from 'react';
import Expo from './Home';
import './style.css'
import fb from './images/fb.jpg'
import insta from './images/insta.png'
import twit from './images/twit.png'

function App() {
  const mystyle = {
    color: "white",
    backgroundColor: "DodgerBlue",
    padding: "10px",
    fontFamily: "Arial"
  };
  return (
    <div>
      <h1 id="logo">SPORTINFO24</h1>
  <Expo />
  <a href="https://facebook.com">
    <img src={fb} alt="fb" width="40" height="40"/>
  </a>
  <a href="https://twitter.com">
    <img src={twit} alt="twit" width="50" height="40"/>
  </a>
  <a href="https://instagram.com">
    <img src={insta} alt="insta" width="40" height="40"/>
  </a>
  <button style={myStyle} id="register">Zarejestruj się</button>
  <button id="login">Zaloguj się</button>
  <button id="scores">WYNIKI</button>
  </div>
  );
}

export default App;
